import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navigation from "../components/Navigation";

function LoginPage() {
  const navigate = useNavigate();
  const [loginData, setLoginData] = useState({
    email: "",
    password: "",
  });

  const [error, setError] = useState("");
  const [isPasswordVisible, setIsPasswordVisible] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setLoginData({ ...loginData, [name]: value });
    setError(""); // Ê∏ÖÈô§ÈîôËØØ‰ø°ÊÅØ
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!loginData.email || !loginData.password) {
      setError("All fields must be filled out");
      return;
    }

    if (loginData.email === "example@example.com" && loginData.password === "password") {
      navigate("/dashboard");
    } else {
      setError("Invalid email or password");
    }
  };

  const togglePasswordVisibility = () => {
    setIsPasswordVisible(!isPasswordVisible);
  };

  // ‰ª•‰∏ãÊòØÈáçÊñ∞ÂÆö‰πâÁöÑÊ†∑ÂºèÂØπË±°
  const errorMessageStyle = {
    color: "#721c24",
    backgroundColor: "#f8d7da",
    borderColor: "#f5c6cb",
    padding: "10px",
    borderRadius: "4px",
    margin: "10px 0 20px",
    border: "1px solid transparent",
    width: "100%",
    textAlign: "center",
    fontWeight: "600",
    boxShadow: "0 0 5px rgba(0,0,0,0.2)",
  };

  const formFieldStyle = {
    display: "flex",
    flexDirection: "column",
    alignItems: "flex-start",
    margin: "10px 0",
    width: "100%",
  };

  const labelStyle = {
    marginBottom: "8px",
    fontWeight: "bold",
    color: "#4CAF50",
  };

  const inputStyle = {
    padding: "12px",
    border: "1px solid #ccc",
    borderRadius: "5px",
    marginBottom: "8px",
    width: "100%",
  };


  const toggleVisibilityButtonStyle = {
    position: 'absolute',
    right: '10px',
    top: '50%',
    transform: 'translateY(-50%)',
    border: 'none',
    background: 'none',
    cursor: 'pointer',
    color: '#4CAF50',
    fontSize: '1rem',
  };
  return (
        <div style={{ backgroundColor: "#F0F2F5", minHeight: "100vh" }}>
          <Navigation />
          <div
            style={{
              padding: "20px",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <h1 style={{ color: "#4CAF50" }}>Login</h1>
            {error && <div style={errorMessageStyle}>{error}</div>}
            <form
              onSubmit={handleSubmit}
              style={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                padding: "40px",
                marginTop: "20px",
                boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
                borderRadius: "8px",
                backgroundColor: "white",
                width: "100%",
                maxWidth: "500px",
              }}
            >
          <div style={formFieldStyle}>
            <label htmlFor="email" style={labelStyle}>
              Email:
            </label>
            <input
              type="email"
              id="email"
              name="email"
              placeholder="Email"
              value={loginData.email}
              onChange={handleChange}
              style={inputStyle}
            />
          </div>
          <div style={{ ...formFieldStyle, position: 'relative' }}>
            <label htmlFor="password" style={labelStyle}>
              Password:
            </label>
            <input
              type={isPasswordVisible ? "text" : "password"}
              id="password"
              name="password"
              placeholder="Password"
              value={loginData.password}
              onChange={handleChange}
              style={inputStyle}
            />
            <button onClick={togglePasswordVisibility} type="button" style={toggleVisibilityButtonStyle}>
              {isPasswordVisible ? 'üôà' : 'üëÅÔ∏è'}
            </button>
          </div>
          <button
            type="submit"
            style={{
              width: "100%",
              padding: "10px",
              backgroundColor: "#4CAF50",
              color: "white",
              border: "none",
              borderRadius: "5px",
              cursor: "pointer",
              boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
              marginTop: "10px",
            }}
          >
            Login
          </button>
        </form>
      </div>
    </div>
  );
}

export default LoginPage;
